INSERT INTO `some_queries` (`id`, `text`, `comment`) VALUES
(1, 'ALTER TABLE `table_name` ADD `created_at` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP AFTER `field`, ADD `creator_id` INT NOT NULL AFTER `created_at`, ADD `updated_at` TIMESTAMP NULL AFTER `creator_id`, ADD `updater_id` INT NULL AFTER `updated_at`, ADD `deleted_at` TIMESTAMP NULL AFTER `updater_id`, ADD `deleter_id` INT NULL AFTER `deleted_at`;', '6 fields'),
(2, 'SELECT\n	pe.id_excavator, \n    pe.id_place, \n    pe.garage, \n    p.title as \'title_place\',\n    e.title as \'title_excavator\'\nFROM  excavators e, places p, places_excavators pe          \nWHERE pe.id_place = p.id AND pe.id_excavator = e.id AND \npe.date_from <= DATE(\'2023-06-15\') AND\n( pe.date_to >= DATE(\'2023-06-15\')  OR pe.date_to IS NULL ) AND \npe.id_place = 111 AND p.id_parent = 100', 'first '),
(3, 'SELECT\n	pe.id_excavator, \n    pe.id_place, \n    pe.garage, \n    p.title as \'title_place\',\n    e.title as \'title_excavator\', \n    de.id as \'id_downtime\',\n    de.id_code,\n    de.start_time,\n    de.end_time, \n    de.details,\n    c.code, \n    c.title,\n    r.type,\n    r.reason, \n    (CASE \n    	WHEN DATE(\'2023-06-17\') = DATE(de.start_time) AND DATE(de.start_time) = DATE(de.end_time) \n     		THEN TIMESTAMPDIFF(SECOND, de.start_time, de.end_time)/3600\n     	WHEN DATE(\'2023-06-17\') = DATE(de.start_time) AND (de.end_time IS NULL OR DATE(\'2023-06-17\') < DATE(de.end_time))     \n     		THEN TIMESTAMPDIFF(SECOND, de.start_time, \'2023-06-18 00:00:00\')/3600 \n     	WHEN DATE(\'2023-06-17\') = DATE(de.end_time) 								\n     		THEN TIMESTAMPDIFF(SECOND, \'2023-06-17 00:00:00\', de.end_time)/3600\n     	WHEN DATE(de.start_time) < DATE(\'2023-06-17\') \n     		THEN 24 \n     	ELSE NULL						\n    END) as \'dayDuration\', \n    \n    (CASE \n     	WHEN DATE(\'2023-06-17\') = DATE(de.start_time) AND DATE(de.start_time) = DATE(de.end_time)  \n     		THEN TIMESTAMPDIFF(SECOND, de.start_time, de.end_time)/3600\n    	WHEN DATE(\'2023-06-17\') = DATE(de.start_time) AND (de.end_time IS NULL OR DATE(\'2023-06-17\') < DATE(de.end_time))\n     		THEN TIMESTAMPDIFF(SECOND, de.start_time, \'2023-06-18 00:00:00\')/3600 \n    	WHEN DATE(\'2023-06-17\') = DATE(de.end_time) 								\n     		THEN TIMESTAMPDIFF(SECOND, de.start_time, de.end_time)/3600\n     	WHEN DATE(\'2023-06-17\') > DATE(de.start_time) AND ( de.end_time IS NULL OR DATE(\'2023-06-17\') < DATE(de.end_time))\n     		THEN TIMESTAMPDIFF(SECOND, de.start_time, \'2023-06-18 00:00:00\')/3600\n    END)  as \'sinceDuration\'\nFROM  excavators e, places p, places_excavators pe, downtimes_excavators de, codes c, reasons r     \nWHERE \n	pe.id_excavator = de.id_excavator AND \n    pe.id_place = de.id_place AND \n    de.id_code = c.id AND \n    c.id_reason = r.id AND \n    pe.id_place = p.id AND pe.id_excavator = e.id AND \n    pe.date_from <= DATE(\'2023-06-17\') AND\n    ( pe.date_to >= DATE(\'2023-06-17\')  OR pe.date_to IS NULL ) AND \n    pe.id_place = 111 AND \n    DATE(de.start_time) <= DATE(\'2023-06-17\') AND \n    ( DATE(de.end_time) >= DATE(\'2023-06-17\') OR de.end_time is null ) \n  ', 'простои'),
(4, 'SELECT e.id, e.title, r.id, r.reason FROM excavators e, places_excavators pe, downtimes_excavators de, codes c \r\nRIGHT JOIN reasons r on r.id = c.id_reason \r\nWHERE e.id = de.id_excavator and pe.id_place = de.id_place and e.id = pe.id_excavator \r\nand pe.id_excavator = de.id_excavator and e.id_group = c.id_technica_group GROUP BY e.id, e.title, r.id ORDER BY `r`.`id` ASC', NULL),
(5, 'SELECT r.id, r.reason, de.id\nFROM reasons r LEFT JOIN codes c on r.id = c.id_reason LEFT JOIN downtimes_excavators de on c.id = de.id_code\nWHERE r.excavator = 1\nGROUP BY r.id, r.reason, de.id', NULL),
(6, 'ExcavatorDowntimeModel::select(\'downtimes_excavators.*\', \'pe.*\', \'places.*\' )->from(\'downtimes_excavators\')\n                ->join(\'places_excavators as pe\', \'pe.id\', \'downtimes_excavators.id_place_excavator\')\n                ->join(\'places\', \'pe.id_place\', \'places.id\')->get();', 'model'),
(7, 'SELECT r.id, r.reason, r.type, r.is_reported, sum(TIMESTAMPDIFF(SECOND, (CASE \n                                                 WHEN DATE(de.start_time) < DATE(\'2023-06-01\')\n                                                  	THEN DATE(\'2023-06-01\')\n                                                  ELSE de.start_time\n                                                 END), (CASE \n                                                 WHEN de.end_time is null OR  DATE(de.end_time) > DATE(\'2023-06-30\') \n                                                    THEN DATE(\'2023-07-01\')\n                                                 ELSE\n                                                    de.end_time\n                                                 END)))/3600 as downtime,\n                                                 de.id_excavator\nFROM reasons r \nLEFT JOIN codes c on r.id = c.id_reason and c.deleted_at is null\nLEFT JOIN downtimes_excavators de on c.id = de.id_code \nand DATE(de.start_time) <= DATE(\'2023-06-30\') \nand (DATE(de.end_time) >= DATE(\'2023-06-01\') OR de.end_time IS NULL) \nand de.deleted_at is null and de.id_place = 111\nWHERE r.excavator = 1 and r.deleted_at is null \nGROUP BY r.id, r.reason, r.type, r.is_reported, de.id_excavator', 'montly excavators'),
(8, 'SELECT \n	pe.id as \'id_place_excavator\', \n    pe.id_place, \n    pe.id_excavator, \n    e.title, \n    pe.garage, \n    f.id as \'id_fact\',\n    p.id as \'id_plan\',\n    p.plan, \n    f.fact, \n    p.plan_month, \n    f.fact_month, \n    p.plan_year,\n    f.fact_year \nFROM excavators e, places_excavators pe \n		LEFT JOIN plans_excavators p ON \n        			pe.id = p.id_place_excavator AND \n                    p.date_plan = \'2023-06-20\' AND \n                    p.deleted_at is null \n        LEFT JOIN facts_excavators f ON \n        			pe.id = f.id_place_excavator AND \n                    f.date_fact = \'2023-06-20\' AND \n                    f.deleted_at is null \nWHERE \n			pe.id_excavator = e.id \n		AND pe.id_place = 111 \n        AND pe.deleted_at is null \n        AND e.deleted_at is null AND \n        DATE(\'2023-06-20\') BETWEEN pe.date_from AND COALESCE(pe.date_to, DATE(\'2023-06-20\'));', 'План, Факт по площадке(карьеру). вместо \'2023-06-20\' = ставите дату... \n'),
(10, 'SELECT\n	r.id as \'id_reason\',\n    r.reason, \n    r.type, \n    r.is_reported,\n    SUM(\n    	TIMESTAMPDIFF(SECOND, \n                      (CASE \n                       	WHEN DATE(de.start_time) = DATE(\'2023-06-05\') \n                       		THEN de.start_time \n                       	WHEN DATE(de.start_time) < DATE(\'2023-06-05\')  AND ( DATE(\'2023-06-05\') <= DATE(de.end_time)  OR de.end_time is NULL)\n                       		THEN \'2023-06-05 00:00:00\' \n                        ELSE NULL \n                       END), \n                      (CASE \n                       	WHEN DATE(de.end_time) = DATE(\'2023-06-05\') \n                       		THEN de.end_time\n                        WHEN DATE(de.start_time) <= DATE(\'2023-06-05\') AND ( DATE(\'2023-06-05\') < DATE (de.end_time) OR de.end_time is NULL)\n                       		THEN \'2023-06-06 00:00:00\'\n                        ELSE NULL \n                       END) \n                     )\n    )/3600 as \'dayDowntime\',\n    \n    SUM(\n    	TIMESTAMPDIFF(SECOND, \n                      (CASE \n                       	WHEN DATE(de.start_time) <= DATE(\'2023-06-05\') AND DATE(de.start_time) >= DATE(\'2023-06-01\')\n                       		THEN de.start_time \n                       	WHEN DATE(de.start_time) < DATE(\'2023-06-01\')  AND ( DATE(\'2023-06-01\') <= DATE(de.end_time)  OR de.end_time is NULL)\n                       		THEN \'2023-06-01 00:00:00\' \n                        ELSE NULL \n                       END), \n                      (CASE \n                       	WHEN DATE(de.end_time) <= DATE(\'2023-06-05\') \n                       		THEN de.end_time                      	\n                        WHEN DATE(de.start_time) <= DATE(\'2023-06-05\') AND ( DATE(\'2023-06-05\') < DATE (de.end_time) OR de.end_time is NULL)\n                       		THEN \'2023-06-06 00:00:00\'\n                        ELSE NULL \n                       END) \n                     )\n    )/3600 as \'sinceDowntime\', \n    de.id_place_excavator,\n    de.id_excavator\n\n\nFROM reasons r \n		LEFT JOIN  codes c  ON \n            c.id_reason = r.id AND \n            c.deleted_at is null\n		LEFT JOIN downtimes_excavators de   ON \n        	de.id_code = c.id  AND \n            DATE(de.start_time) <= DATE(\'2023-06-30\') AND \n            (DATE(de.end_time) >= DATE(\'2023-06-01\') OR de.end_time is NULL ) AND \n            de.id_place_excavator IN ( 2, 3, 4,  10, 11, 13, 25, 26, 27, 28) AND \n            de.deleted_at is null \nWHERE r.deleted_at IS NULL AND r.excavator = 1 \n\nGROUP BY r.id, r.reason, de.id_place_excavator, de.id_excavator,   r.type,  r.is_reported', 'dailiy reasons downtimes '),
(11, 'SELECT\n	r.id as \'id_reason\',\n    r.reason, \n    r.type, \n    r.is_reported,\n    \n    SUM(\n    	TIMESTAMPDIFF(SECOND, \n                      (CASE \n                       	WHEN DATE(de.start_time) <= DATE(\'2023-07-20\') AND DATE(de.start_time) >= DATE(\'2023-07-01\')\n                       		THEN de.start_time \n                       	WHEN DATE(de.start_time) < DATE(\'2023-07-01\')  AND ( DATE(\'2023-07-01\') <= DATE(de.end_time)  OR de.end_time is NULL)\n                       		THEN \'2023-07-01 00:00:00\' \n                        ELSE NULL \n                       END), \n                      (CASE \n                       	WHEN DATE(de.end_time) <= DATE(\'2023-07-21\') \n                       		THEN de.end_time                      	\n                        WHEN DATE(de.start_time) <= DATE(\'2023-07-21\') AND ( DATE(\'2023-07-21\') < DATE (de.end_time) OR de.end_time is NULL)\n                       		THEN \'2023-07-22 00:00:00\'\n                        ELSE NULL \n                       END) \n                     )\n    )/3600 as \'sinceDowntime\'\n\nFROM reasons r \n		LEFT JOIN  codes c  ON \n            c.id_reason = r.id AND \n            c.deleted_at is null\n		LEFT JOIN downtimes_excavators de   ON \n        	de.id_code = c.id  AND \n            DATE(de.start_time) <= DATE(\'2023-07-30\') AND \n            (DATE(de.end_time) >= DATE(\'2023-07-01\') OR de.end_time is NULL ) AND \n            de.id_place = 113 AND \n            de.deleted_at is null \nWHERE r.deleted_at IS NULL AND r.excavator = 1 \n\nGROUP BY r.id, r.reason,  r.type,  r.is_reported', 'Простои с начала месяца с учётом уже выбывших экскаваторов\n'),
(12, 'SELECT\n SUM((CASE \n     	WHEN p.date_plan BETWEEN DATE(\'2023-08-01\') AND DATE(\'2023-08-31\')\n     		THEN  p.plan_month\n 	 	ELSE NULL\n      END\n   )) as \'plan_month\', \n SUM(p.plan_year) as \'plan_year\'\nFROM plans_excavators p, \n(\n    SELECT a.id_place_excavator, MAX(a.date_plan) as \'maxDate\'\n    FROM plans_excavators a \n    WHERE a.deleted_at is null AND a.id_place = 113 \n    GROUP BY a.id_place_excavator\n) p1 \nWHERE p.date_plan = p1.maxDate  AND p.id_place_excavator = p1.id_place_excavator AND p.id_place_excavator in ( SELECT\npe.id \nFROM places_excavators pe \nWHERE pe.id_place = 113 AND pe.date_to < DATE(\'2023-08-21\') AND YEAR(pe.date_to) = \'2023\' AND pe.deleted_at is null\n)', 'планы с начала месяца и года уже выбывших экскаваторов\n'),
(13, 'SELECT\n SUM(f.fact_month) as \'fact_month\', \n SUM(f.fact_year) as \'fact_year\'\nFROM facts_excavators f, \n(\n    SELECT a.id_place_excavator, MAX(a.date_fact) as \'maxDate\'\n    FROM facts_excavators a \n    WHERE a.deleted_at is null AND a.id_place = 113 \n    GROUP BY a.id_place_excavator\n) f1 \nWHERE f.date_fact = f1.maxDate  AND f.id_place_excavator = f1.id_place_excavator AND f.id_place_excavator in ( SELECT\npe.id \nFROM places_excavators pe \nWHERE pe.id_place = 113 AND pe.date_to < DATE(\'2023-07-21\')\n)', 'факты с начала месяца уже выбывших экскаваторов'),
(14, 'SELECT\nSUM(DAY(p.date_to)*24) as \'addingHours\'\nFROM places_excavators p \nWHERE p.deleted_at is null and p.id_place = 113 AND \nDATE(\'2023-07-01\') <= p.date_to  AND  p.date_to < DATE(\'2023-07-21\') ', 'Добавочное время работы* с начала месяца'),
(16, 'SELECT\n	r.id as \'id_reason\',\n    r.reason, \n    r.type, \n    r.is_reported, /* 3 июль */ \n    ROUND(SUM(\n    	TIMESTAMPDIFF(SECOND, \n                      (CASE \n                       	WHEN \'2023-07-02 20:00:00\' <= de.start_time AND de.start_time  <  \'2023-07-03 20:00:00\' \n                       		THEN de.start_time \n                       	WHEN de.start_time < \'2023-07-02 20:00:00\'  AND ( \'2023-07-02 20:00:00\' <= de.end_time  OR de.end_time is NULL)\n                       		THEN \'2023-07-02 20:00:00\' \n                        ELSE NULL \n                       END), \n                      (CASE \n                       	WHEN \'2023-07-02 20:00:00\' <= de.end_time  AND de.end_time < \'2023-07-03 20:00:00\'  \n                       		THEN de.end_time\n                        WHEN de.start_time < \'2023-07-03 20:00:00\' AND ( \'2023-07-03 20:00:00\' < de.end_time OR de.end_time is NULL)\n                       		THEN \'2023-07-03 20:00:00\'\n                        ELSE NULL \n                       END) \n                     )\n    )/3600, 2) as \'dayDowntime\',\n    \n    ROUND(SUM(\n    	TIMESTAMPDIFF(SECOND, \n                      (CASE \n                       	WHEN \'2023-06-30 20:00:00\' <= de.start_time AND de.start_time < \'2023-07-03 20:00:00\' \n                       		THEN de.start_time\n                      	WHEN de.start_time < \'2023-06-30 20:00:00\' AND (\'2023-06-30 20:00:00\' <= de.end_time OR de.end_time is null )\n                            THEN \'2023-06-30 20:00:00\'\n                        ELSE NULL \n                       END), \n                      (CASE \n                       	WHEN  \'2023-06-30 20:00:00\' <= de.end_time  AND de.end_time < \'2023-07-03 20:00:00\'\n                       		THEN de.end_time\n                      	WHEN de.start_time < \'2023-06-30 20:00:00\' AND (\'2023-07-03 20:00:00\' < de.end_time OR de.end_time is null)\n                       		THEN \'2023-07-03 20:00:00\'\n                        ELSE NULL \n                       END) \n                     )\n    )/3600, 2) as \'sinceDowntime\', \n    de.id_place_excavator,\n    de.id_excavator\n\nFROM reasons r \n		LEFT JOIN  codes c  ON \n            c.id_reason = r.id AND \n            c.deleted_at is null\n		LEFT JOIN downtimes_excavators de   ON \n        	de.id_code = c.id  AND \n        	de.start_time <= \'2023-07-03 20:00:00\' AND \n        	(de.end_time >= \'2023-06-30 20:00:00\' OR de.end_time is null) AND \n            de.id_place_excavator IN (2, 3, 4,  10, 11, 13, 25, 26, 27, 28) AND \n            de.deleted_at is null \nWHERE r.deleted_at IS NULL AND r.excavator = 1 \nGROUP BY r.id, r.reason, de.id_place_excavator, de.id_excavator,   r.type,  r.is_reported;', 'dailiy reasons downtimes ----- with shifts'),
(17, 'SELECT\n	r.id as \'id_reason\',\n    r.reason, \n    r.type, \n    r.is_reported, \n\n    ROUND(SUM(\n    	TIMESTAMPDIFF(SECOND, \n                      (CASE \n                       	WHEN \'2023-06-30 20:00:00\' <= de.start_time AND de.start_time < \'2023-07-03 20:00:00\' \n                       		THEN de.start_time\n                      	WHEN de.start_time < \'2023-06-30 20:00:00\' AND (\'2023-06-30 20:00:00\' <= de.end_time OR de.end_time is null )\n                            THEN \'2023-06-30 20:00:00\'\n                        ELSE NULL \n                       END), \n                      (CASE \n                       	WHEN  \'2023-06-30 20:00:00\' <= de.end_time  AND de.end_time < \'2023-07-03 20:00:00\'\n                       		THEN de.end_time\n                      	WHEN de.start_time < \'2023-07-03 20:00:00\' AND (\'2023-07-03 20:00:00\' < de.end_time OR de.end_time is null)\n                       		THEN \'2023-07-03 20:00:00\'\n                        ELSE NULL \n                       END) \n                     )\n    )/3600, 2) as \'excludedDowntime\'\n\nFROM reasons r \n		LEFT JOIN  codes c  ON \n            c.id_reason = r.id AND \n            c.deleted_at is null\n		LEFT JOIN downtimes_excavators de   ON \n        	de.id_code = c.id  AND \n        	de.start_time <= \'2023-07-03 20:00:00\' AND \n        	(de.end_time >= \'2023-06-30 20:00:00\' OR de.end_time is null) AND \n            de.id_place = 113 AND \n            de.deleted_at is null \nWHERE r.deleted_at IS NULL AND r.excavator = 1 \nGROUP BY r.id, r.reason,  r.type,  r.is_reported;', 'Простои с начала месяца с учётом уже выбывших экскаваторов --- with shifts'),
(18, 'SELECT\n	pe.id_excavator, \n    pe.id_place, \n    pe.garage, \n    p.title as \'title_place\',\n    e.title as \'title_excavator\', \n    de.id as \'id_downtime\',\n    de.id_code,\n    de.start_time,\n    de.end_time, \n    de.details,\n    c.code, \n    c.title,\n    r.type,\n    r.reason, \n    (CASE \n     	WHEN de.start_time BETWEEN \'2023-06-27 21:10:00\' AND \'2023-06-28 21:10:00\' AND de.end_time BETWEEN \'2023-06-27 21:10:00\' AND \'2023-06-28 21:10:00\' \n     		THEN ROUND(TIMESTAMPDIFF(SECOND, de.start_time, de.end_time)/3600, 2)\n     	WHEN de.start_time BETWEEN \'2023-06-27 21:10:00\' AND \'2023-06-28 21:10:00\' AND (de.end_time IS NULL OR \'2023-06-28 21:10:00\' < de.end_time) \n     		THEN ROUND(TIMESTAMPDIFF(SECOND, de.start_time, \'2023-06-28 21:10:00\')/3600 , 2)\n     	WHEN de.end_time BETWEEN \'2023-06-27 21:10:00\' AND \'2023-06-28 21:10:00\' AND de.start_time < \'2023-06-27 21:10:00\' \n     		THEN ROUND(TIMESTAMPDIFF(SECOND, \'2023-06-27 21:10:00\', de.end_time)/3600, 2)\n     	WHEN de.start_time < \'2023-06-27 21:10:00\' AND \'2023-06-28 21:10:00\' < de.end_time \n     		THEN 24 \n     	ELSE NULL						\n    END) as \'dayDuration\', \n    \n    (CASE \n     	WHEN de.start_time BETWEEN \'2023-06-27 21:10:00\' AND \'2023-06-28 21:10:00\' AND de.end_time BETWEEN \'2023-06-27 21:10:00\' AND \'2023-06-28 21:10:00\' \n     		THEN ROUND(TIMESTAMPDIFF(SECOND, de.start_time, de.end_time)/3600, 2)\n    	WHEN de.start_time BETWEEN \'2023-06-27 21:10:00\' AND \'2023-06-28 21:10:00\' AND (de.end_time IS NULL OR \'2023-06-28 21:10:00\' < de.end_time) \n     		THEN ROUND(TIMESTAMPDIFF(SECOND, de.start_time, \'2023-06-28 21:10:00\')/3600 , 2)\n    	WHEN de.end_time BETWEEN \'2023-06-27 21:10:00\' AND \'2023-06-28 21:10:00\' AND de.start_time < \'2023-06-27 21:10:00\' \n     		THEN ROUND(TIMESTAMPDIFF(SECOND, \'2023-06-27 21:10:00\', de.end_time)/3600, 2)\n     	WHEN de.start_time < \'2023-06-27 21:10:00\' AND \'2023-06-28 21:10:00\' < de.end_time \n     		THEN ROUND(TIMESTAMPDIFF(SECOND, de.start_time, \'2023-06-28 21:10:00\')/3600, 2)\n     	ELSE NULL\n    END)  as \'sinceDuration\'\nFROM  excavators e, places p, places_excavators pe, downtimes_excavators de, codes c, reasons r     \nWHERE \n	pe.id_excavator = de.id_excavator AND \n    pe.id_place = de.id_place AND \n    de.id_code = c.id AND \n    c.id_reason = r.id AND \n    pe.id_place = p.id AND pe.id_excavator = e.id AND \n    pe.date_from <= DATE(\'2023-06-28\') AND\n    ( pe.date_to >= DATE(\'2023-06-28\')  OR pe.date_to IS NULL ) AND \n    pe.id_place = 113 AND \n    de.start_time <= \'2023-06-28 21:10:00\' AND \n    ( de.end_time >= \'2023-06-27 21:10:00\' OR de.end_time is null ) \n   AND de.deleted_at is null\nORDER BY de.start_time', 'downtimes - список по карьеру за день'),
(19, 'SELECT\n    pe.id_excavator,\n    pe.id_place,\n    pe.garage,\n    p.title AS \'title_place\',\n    e.title AS \'title_excavator\',\n    de.id AS \'id_downtime\',\n    de.id_code,\n    de.start_time,\n    de.end_time,\n    de.details,\n    c.code,\n    c.title,\n    r.type,\n    r.reason,\n    ROUND(\n        TIMESTAMPDIFF(\n            SECOND,\n            (\n                CASE WHEN \'2023-06-29 21:10:00\' <= de.start_time AND de.start_time < \'2023-06-30 21:10:00\' THEN de.start_time WHEN de.start_time < \'2023-06-29 21:10:00\' AND(\n                    \'2023-06-29 21:10:00\' <= de.end_time OR de.end_time IS NULL\n                ) THEN \'2023-06-29 21:10:00\' ELSE NULL\n            END\n        ),\n        (\n            CASE WHEN \'2023-06-29 21:10:00\' <= de.end_time AND de.end_time < \'2023-06-30 21:10:00\' THEN de.end_time WHEN de.start_time < \'2023-06-30 21:10:00\' AND(\n                \'2023-06-30 21:10:00\' < de.end_time OR de.end_time IS NULL\n            ) THEN \'2023-06-30 21:10:00\' ELSE NULL\n        END\n    )\n) / 3600,\n2\n) AS \'dayDuration\',\nROUND(\n    TIMESTAMPDIFF(\n        SECOND,\n        (\n            CASE WHEN \'2023-05-31 21:10:00\' <= de.start_time AND de.start_time < \'2023-06-30 21:10:00\' THEN de.start_time WHEN de.start_time < \'2023-05-31 21:10:00\' AND(\n                \'2023-05-31 21:10:00\' <= de.end_time OR de.end_time IS NULL\n            ) THEN \'2023-05-31 21:10:00\' ELSE NULL\n        END\n    ),\n    (\n        CASE WHEN \'2023-05-31 21:10:00\' <= de.end_time AND de.end_time < \'2023-06-30 21:10:00\' THEN de.end_time WHEN de.start_time < \'2023-05-31 21:10:00\' AND(\n            \'2023-06-30 21:10:00\' < de.end_time OR de.end_time IS NULL\n        ) THEN \'2023-06-30 21:10:00\' ELSE NULL\n    END\n)\n) / 3600,\n2\n) AS \'sinceDowntime\'\nFROM\n    excavators e,\n    places p,\n    places_excavators pe,\n    downtimes_excavators de,\n    codes c,\n    reasons r\nWHERE\n    pe.id_excavator = de.id_excavator AND pe.id_place = de.id_place AND de.id_code = c.id AND c.id_reason = r.id AND pe.id_place = p.id AND pe.id_excavator = e.id AND pe.date_from <= DATE(\'2023-06-30\') AND(\n        pe.date_to >= DATE(\'2023-06-30\') OR pe.date_to IS NULL\n    ) AND pe.id_place = 113 AND de.start_time <= \'2023-06-30 21:10:00\' AND(\n        de.end_time >= \'2023-05-31 21:10:00\' OR de.end_time IS NULL\n    ) AND de.deleted_at IS NULL\nORDER BY\n    de.start_time\n             ', 'ERR::check then deleted'),
(20, 'SELECT\npe.id as \'id_place_excavator\',\npe.id_place as \'id_place\',\npe.id_excavator as \'id_excavator\',\nr.reason, \nr.id as \'id_reason\',\nc.id as \'id_code\',\nc.code as \'code\',\nc.title as \'title_code\',\npe.garage as \'garage\',\nde.start_time, \nde.end_time,\nTIMESTAMPDIFF(SECOND, \n              (\n                  CASE \n                  	WHEN de.start_time < \'2023-06-30 21:10:00\' \n                  		THEN \'2023-06-30 21:10:00\'\n                    ELSE de.start_time\n                  END\n               ), \n               ( \n                   CASE\n                   		WHEN de.end_time > \'2023-07-10 21:10:00\' \n                   			THEN \'2023-07-10 21:10:00\'\n                  		ELSE de.end_time\n                   END\n               )\n              )/3600 as \'sinceDowntime\'\nFROM  places_excavators pe,     reasons r , codes c,  downtimes_excavators de \nWHERE \n	c.id_reason = r.id AND\n    de.id_code = c.id AND \n    de.id_place_excavator = pe.id AND\n    de.start_time < \'2023-07-10 21:10:00\' AND \n    ( de.end_time > \'2023-06-30 21:10:00\' OR de.end_time is null ) AND \n    c.deleted_at is null AND \n    c.deleted_at is null AND\n    pe.deleted_at is null AND\n    de.deleted_at is null AND\n    pe.id = 30\nORDER BY de.start_time\n    ', 'простой по одному экскаватору ');
